import React from 'react';

export default (props) => {
    console.log('DETAILED PROPS: ', props);
    let contact = props.contacts[0];
    console.log('CURRENT CONTACTS IS:', contact);
    return (
        <div>
            <h2>{contact.name} {contact.lastName}</h2>
            <img src='../' />
             {contact.phone}
            <img src="./img/multimedia.png" alt="" />{contact.email}
            <img src="./img/buildings.png" alt="" />{contact.address}
            <h3>Description: {contact.description}</h3>
            <button>Edit</button><button>Remove</button>
        </div>
    );
}
